import React from "react";
import logo from "../src/Images/logo.png";
import "./App.css";
import "bootstrap/dist/css/bootstrap.min.css";
import { NavLink as Link } from "react-router-dom";




function App() {
  return (

<ul id="Nav_menu">
  <li>
    <NavLink
      to="/home"
      className="Nav_link"
      activeClassName="activeRoute"
      activeStyle={{ color: 'teal' }}
    >
      HOME
    </NavLink>
  </li>
  <li>
    <NavLink
    to="/products"
    className="Nav_link"
    activeClassName="activeRoute"
    activeStyle={{ color: 'teal' }}
    >
      PRODUCTS
    </NavLink>
  </li>
</ul>
  );
}

export default App;
